import {API} from "../../backend";
const axios = require('axios');

// getAllProduts
export const getAllProducts = () => {
    return axios.get(`${API}/products`)
    .then((response) => {
        console.log("Response" + response.data);
        return response.data;
    })
    .catch((error) => {
        console.log(error);
    })
}
